const dataItems = await app.codeList.get(
'web.base__bi_chart_type2',
context,
params,
);
const item =dataItems.find(x => x.value === data.chart_type);
if (item && item.sysImage) {
    return '<div class="ibiz-code-list__item" style="height: 36px;line-height: 36px;"><div class="ibiz-icon" style="margin-top: -24px;padding-right: 8px;">' + item.sysImage.rawContent + '</div>' + data.name + '</div>';
